import ReactDOM from 'react-dom/client';
import './CSS/index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <h1>I am so handsome</h1>
  </React.StrictMode>
);
